const api = "https://frebi.willandskill.eu/api-token-auth/"

export default class UserKit {
    
    static login(payload){
    
        return fetch(api,{
            method: "POST", 
            body: JSON.stringify(payload),
            headers: {
                "Content-type": "application/json"
              }
        })
    
    }
}
